import React from 'react'
import "./formInput.css"

function FormInput(props) {

  return (
    <div className = "formInput">
      <label htmlFor="">{}</label>
      <input onChange = {e=>props.setFirstname(e.target.value)} placeholder = {props.placeholder}/>
    </div>
  )
}

export default FormInput;
